import React, { Component } from 'react';
import Repo from "./Repo"
export default class Table extends Component {
  render() {
   const {array} = this.props
   console.log(array);
    return (
      <div style={{ border: '3px green dotted' }}>
        <h6>Table</h6>
     {array.map((item) => {
     return   <Repo key={item.id}>item.title</Repo>
     })}

      </div>
    );
  }
}
